script: |
  super -f text -I q9632.spq | sort > q9632.out

inputs:
  - name: q9632.spq
    data: |
      SELECT DISTINCT + cor0.col2 * + col0 + col1 + cor0.col0 * - col0 * + col0 AS col2 FROM tab2 (FORMAT parquet) cor0;
  - name: tab2

outputs:
  - name: q9632.out
    data: |
      -123
      -472465
      -490020
